window.bookSummaryJSON = "<p>Don’t piss off the Elite Class.</p> <p>That wasn’t in the rulebook, but it should have been. Landon, Michael, and Cole may have the faces of angels, but a soul turns black when it’s betrayed.</p> <p>The Elites have sworn to take me down, but I can’t get much lower.</p> <p>Or so I thought.</p> <p>Breakbattle wants us to fight and the boys are happy to oblige.</p> <p>No one will help me. No one can. I either show I'm strong enough to rise, or I suffer at the bottom where I belong.</p> <p>They'll try to break me. They may even succeed. But I can't leave. I can't reveal myself.</p> <p>I became Zeke for one reason...and I'm not done yet.</p> <p><b><i>The Plan</i></b><b> is a reverse harem high school bully romance. This is year one in the series and features language, dark themes, and sexual scenes. If you're cool with that, dive in!</b></p>"; 
